import Hero from "./components/Hero";
import Card from "./components/Card";
import About from "./components/About";

const HomeStudent = () => {
  return (
    <div className="w-full justify-center my-12">
      <Hero />
      <Card />
      <About />
    </div>
  );
};

export default HomeStudent;
